import React from 'react';
import './App.css';
import styles from './Footer.module.css';

function Footer() {
  return (
    <div className={styles.bottom}>
      <dl>
        <dd>timur2003333@gmail.com</dd>
        <dd>+380968309942</dd>
      </dl>
    </div>
  );
}

export default Footer;
